schemaDefinition: "create or replace view MVB_TF_UNIFIEDSS_USER_TERRITORY_SECURITY(\n\
  \tTERRITORYSYSID,\n\tORIG_USERID,\n\t'random',\n\tBIN,\n\t'random'\n) as\n\n\n\n\
  \n\n\n\n\n\n\nSELECT\tTERRITORYSYSID, LISTAGG('random','random') AS ORIG_USERID\
  \ , 'random' ,'random',\n \t        CASE WHEN 'random' IN (SELECT 'random'\n \t\
  \ \t \t \t \t \t \t \t \t \t FROM 'random'.'random'.'random'\n                 \
  \                         WHERE ('random' = 'random'\n                         \
  \                   AND 'random' = 'random'\n                                  \
  \          AND 'random' = 'random')\n \t                                  )\n\n\n\
  \n\n\n\n \t             THEN 'random'\n                  ELSE 'random'\n       \
  \         END AS 'random'\n \t\tFROM ( SELECT\tTERRITORYSYSID, 'random', 'random','random',\
  \ CONCAT('random',CEIL((LEN)/'random')) 'random'\n \t\t\t\t   FROM (\n \t\t\t\t\t\
  SELECT DISTINCT TERRITORYSYSID, 'random', 'random'\n \t\t\t\t\t\t\t,SUM (LENGTH('random')+'random')\
  \ over(partition by TERRITORYSYSID ORDER BY TERRITORYSYSID, LVL, USERID ROWS BETWEEN\
  \ UNBOUNDED PRECEDING AND CURRENT ROW  ) 'random'\n \t\t\t\t\tFROM (\n \t\t\t\t\t\
  \t SELECT DISTINCT UE.'random' AS 'random', TERRITORYSYSID,LVL, UE.'random' AS 'random'\n\
  \ \t \t\t\t\t\t\tFROM 'random'.'random'.'random' UE\n \t \t\tINNER JOIN (\n\n\n\t\
  \t\t\t\t\t\tWITH TUL AS\n\t\t\t\t\t\t\t\t(SELECT TERRITORYSYSID,USERID,LVL\n\t\t\
  \t\t\t\t\t\tFROM 'random'.'random'.'random')\n\t\t\t\t\t\t\t\tSELECT TERRITORYSYSID,USERID,LVL\
  \ FROM TUL\n\t\t\t\t\t\t\t\tUNION\n\t\t\t\t\t\t\t\tSELECT distinct 'random' AS TERRITORYSYSID,USERID,LVL\
  \ FROM TUL\n\t\t\t\t\t\t\t\t\tWHERE LVL = 'random'\n\n \t\t\t\t\t\t\t) A\n \t\t\t\
  \t\t\t\tON LOWER(UE.'random') = LOWER(USERID)\n \t\t\t\t\t\t\t)\n \t\t\t\t \t)\n\
  \ \t\t\t\t) GROUP BY 'random', TERRITORYSYSID, 'random';"
